import React from 'react'
import { useNavigate } from 'react-router-dom'
import './Home.css'
import NavBar from './NavBar';

export default function Home() {
  const navigate = useNavigate()

  const onRequestClick = () => {
    navigate('/request')
  }

  const onScheduleClick = () => {
    navigate('/schedule')
  }

  const onHistoryClick = () => {
    navigate('/history')
  }

  return (
    <>
      <div className={'mainContainer'}>
        <NavBar />
        <div className={'homeContainer'}>
          <button className={'homeButton'} onClick={onRequestClick} >Request a Ride</button>
        </div>
        <div className={'homeContainer'}>
          <button className={'homeButton'} onClick={onScheduleClick} >View Scheduled Rides</button>
        </div>
        <div className={'homeContainer'}>
          <button className={'homeButton'} onClick={onHistoryClick} >Ride History</button>
        </div>
      </div>
    </>
  )
}
